import React from 'react';
import JobCard from "./JobCard";
import SchoolCard from "./SchoolCard";
import Skills from "./skillsCard";

function App() {
    return(
    <main>
      <h1>RESUME</h1>
      <section><h2>Dedicated, Oriented and Precise</h2>
        <p></p>
      </section>
      <section>
        <JobCard />
      </section>
      <section>
        <SchoolCard />
      </section>
      <section>
        <Skills />
      </section>
    </main>
    )
}

export default App;
